def calcular_area():
    limpiar_campos_a()  
    ComboAreas.config(state="disabled")
    ButtonCombo.pack_forget() 
    forma = ComboAreas.get()

    def mostrar_resultado(area):
        resultado_entry.delete(0, tk.END)
        resultado_entry.insert(0, f"Área: {round(area, 2)}")

    def calcular():
        if forma == 'Calculo de Area de CUADRADO':
            lado = float(input_1.get())
            area = lado * lado
            mostrar_resultado(area)
        elif forma == 'Calculo de Area de RECTANGULO':
            lado1 = float(input_1.get())
            lado2 = float(input_2.get())
            area = lado1 * lado2
            mostrar_resultado(area)
        elif forma == 'Calculo de Area de TRIANGULO':
            base = float(input_1.get())
            altura = float(input_2.get())
            area = (base * altura) / 2
            mostrar_resultado(area)
        elif forma == 'Calculo de Area de CIRCULO':
            radio = float(input_1.get())
            area = 3.141516 * radio ** 2
            mostrar_resultado(area)
        elif forma == 'Calculo de Area de POLIGONO REGULAR':
            lados = float(input_1.get())
            longitud = float(input_2.get())
            apotema = float(input_3.get())
            area = (lados * longitud * apotema) / 2
            mostrar_resultado(area)

    #ESTO ES PARA DEFINIR LOS CAMPOS DE ENTRADA
    if forma == 'Calculo de Area de CUADRADO':
        tk.Label(campos_frame, text="Ingrese el lado del cuadrado:").pack()
        input_1 = tk.Entry(campos_frame)
        input_1.pack()
    elif forma == 'Calculo de Area de RECTANGULO':
        tk.Label(campos_frame, text="Ingrese el lado 1 del rectángulo:").pack()
        input_1 = tk.Entry(campos_frame)
        input_1.pack()
        tk.Label(campos_frame, text="Ingrese el lado 2 del rectángulo:").pack()
        input_2 = tk.Entry(campos_frame)
        input_2.pack()
    elif forma == 'Calculo de Area de TRIANGULO':
        tk.Label(campos_frame, text="Ingrese la base del triángulo:").pack()
        input_1 = tk.Entry(campos_frame)
        input_1.pack()
        tk.Label(campos_frame, text="Ingrese la altura del triángulo:").pack()
        input_2 = tk.Entry(campos_frame)
        input_2.pack()
    elif forma == 'Calculo de Area de CIRCULO':
        tk.Label(campos_frame, text="Ingrese el radio del círculo:").pack()
        input_1 = tk.Entry(campos_frame)
        input_1.pack()
    elif forma == 'Calculo de Area de POLIGONO REGULAR':
        tk.Label(campos_frame, text="Ingrese el número de lados del polígono:").pack()
        input_1 = tk.Entry(campos_frame)
        input_1.pack()
        tk.Label(campos_frame, text="Ingrese la longitud de un lado:").pack()
        input_2 = tk.Entry(campos_frame)
        input_2.pack()
        tk.Label(campos_frame, text="Ingrese el apotema del polígono:").pack()
        input_3 = tk.Entry(campos_frame)
        input_3.pack()

    #ESTE ES EL BOTON PARA CALCULAR EL AREA 
    calcular_button = tk.Button(campos_frame, text="Calcular Área", bg="white", command=calcular)
    calcular_button.pack()

    #ESTO ES PARA MOSTRAR EL RESULTADO 
    campos_frame.pack(pady=10)
    resultado_label.pack()
    resultado_entry.pack(pady=10)
    cambiar_opcion_areas_buton.pack(pady=20)

