#ESTAS CON LAS FUNCIONES PARA CALCULAR O HACER LAS OPERACIONES
def calcular():
    try:
        resultado = str(eval(pantalla.get()))
        pantalla.delete(0, tk.END)
        pantalla.insert(tk.END, resultado)
    except:
        pantalla.delete(0, tk.END)
        pantalla.insert(tk.END, "Error")
        
#ESTA ES LA FUNCION PARA ACTUALIZAR LA PANTALLA DE NUESTRA CALCULADORA
