# Función para decodificar y mostrar la imagen Base64
def decodificar_imagen_base64(imagen_base64):
    imagen_bytes = base64.b64decode(imagen_base64)
    imagen_buffer = BytesIO(imagen_bytes)
    imagen = Image.open(imagen_buffer)
    return imagen

